import React from "react";
import { Link } from "react-router-dom";

const fields = [
  {
    label: "Full Name",
    type: "text",
  },
];

const formStyle = {
  // margin: 'auto',
  padding: "30px",
  border: "1px solid #c9c9c9",
  borderRadius: "5px",
  background: "#f5f5f5",
  width: "400px",
  display: "block",
  minHeight: "300px",
  display: "flex",
  alignItems: "center",
  justifyContent: "center",
};

const labelStyle = {
  // margin: '10px 0 5px 0',
  fontFamily: "Arial, Helvetica, sans-serif",
  fontSize: "20px",
  backgroundColor: "green",
  borderRadius: "8px",
  padding: "25px",
  // minHeight : "50px",
  marginBottom: "20px",
  color: "white",
};

class Success extends React.Component {
  render() {
    return (
      <div style={formStyle}>
        <div>
          <div style={labelStyle}>{"Successfully Registered!"}</div>

          <nav>
            <div style={{ display: "flex", justifyContent: "center" }}>
              <span>{"To login "}</span>
              <span>&nbsp;</span>
              <Link
                to={"/login"}
                style={{
                  display: "flex",
                  alignItems: "center",
                  justifyContent: "center",
                  textDecoration: "none",
                }}
              >
                <span>{" Click Here"}</span>
              </Link>
            </div>
          </nav>
        </div>
      </div>
    );
  }
}

export default Success;
